(40, 1, '2016-05-12 01:30:33', '2016-05-12 01:30:33', '[audio src="http://demo.zotheme.com/wordpress/zap/wp-content/uploads/2015/08/audio.mp3"][/audio]\r\nL<a href="http://carbon3d.com/" target="_blank">Carbon3D</a>, a company unknown until now, just came out with groundbreaking 3D printing technology which is 25 to 100 times faster than currently available commercial PolyJet or SLA machines. It is a true quantum leap forward for 3D printing speed!\r\n\r\n<img class="aligncenter wp-image-41 size-full" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/3dprinting-history.jpg" alt="3dprinting-history" width="913" height="447" />\r\n\r\nThe company uses new 3D printing process they named Continuous Liquid Interface Production or CLIP. This new process has some similarities with DLP SLA but uses additional lens like oxygen permeable layer in the resin vat that enables changing pulses of UV light and oxygen to build the object in fast continuous flow.', 'Carbon3D Reaches Incredible 3D Printing Speeds with CLIP!', '', 'publish', 'open', 'open', '', 'audio-format-post', '', '', '2016-05-23 03:46:28', '2016-05-23 03:46:28', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?p=40', 0, 'post', '', 0),
(41, 1, '2016-05-12 01:29:47', '2016-05-12 01:29:47', '', '3dprinting-history', '', 'inherit', 'open', 'closed', '', '3dprinting-history', '', '', '2016-05-12 01:29:47', '2016-05-12 01:29:47', '', 40, 'http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/3dprinting-history.jpg', 0, 'attachment', 'image/jpeg', 0),
(42, 1, '2016-05-12 01:31:58', '2016-05-12 01:31:58', '<blockquote><em>Recently Natural Machines made the news with more detailed specifications about their long-expected<a title="Healthy food printer" href="http://3dprinting.com/3dprinters/foodini290314/" target="_blank">healthy food printer</a>,which will be released later on this year. The news was remarkable, as food printing today mainly refers to producing less healthy products, such as<a title="Chocolates" href="http://3dprinting.com/news/3d-print-face-chocolate/" target="_blank">chocolates</a>,<a title="3D printed sweets" href="http://3dprinting.com/news/new-3d-printer-can-print-sweets/" target="_blank">sweets</a>and<a title="Space pizza" href="http://3dprinting.com/materials/edibles-food/nasa-eating-3d-printed-pizza-space/" target="_blank">space pizzas</a>. Now, only two weeks later, another party is trying the healthier side of food printing. And not just some party, because its the European Union, working on a food printer to prepare personalized meals for the elder</em></blockquote>\r\nThis project regards to an older target group, as in 2025 one in five citizens in the EU will be 65-years-old and over. The general problem with this group is that a lot of them will undergo difficulties swallowing their food. This condition is called dysphagia and studies show that today 15 to 25 percent of all people over 50 years suffer from such a condition. The problem however is that the same group has a higher risk of getting sick in some way, which often requires specialized diets. If someone cant swallow properly, then that surely is a problem.\r\n\r\n<img src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/blog-8.jpg" />\r\n\r\nOf course there are pureed foods to provide fornutritious meals, without having to face the difficulties of swallowing larger pieces. However, as the team behind the EU project points out, such pureed meals can be unappealing and unappetizing to the elderly, leading to a reduced quality of life. Moreover, an <a title="NCBI" href="http://www.ncbi.nlm.nih.gov/pubmed/11956839?dopt=Abstract" target="_blank">NCBI study</a> shows that one-third of the people withdysphagia even avoid eating with others, because of their disease.', 'EU Works on Food Printer to Create Personalized Meals for the Elderly', '', 'publish', 'open', 'open', '', 'quote-format-post', '', '', '2016-05-23 04:17:21', '2016-05-23 04:17:21', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?p=42', 0, 'post', '', 0),
(43, 1, '2016-05-12 01:36:26', '2016-05-12 01:36:26', '[gallery columns="1" size="full" ids="44,45"]\r\nWe automatically tend to link the concept of drones with controversial war stories, but a Belgian team proves that this technique could also be used differently. Meet <a title="Airbutlr" href="http://www.airbutlr.com/" target="_blank">AirButlr</a>, a 3D printed drone that is expected to be able to clean your house. A team is still working on the machine, but it will one day be capable of detecting dirt and using several cleaning materials to clean up the dirty places in your house. In other words: in the 21st century we dont need the work of humans to make our cleaning work happen.\r\n\r\n<img class="aligncenter wp-image-41 size-full" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/3dprinting-history.jpg" alt="3dprinting-history" width="913" height="447" />\r\n\r\nThe machine will detect dirt, because it works with advanced sensors, batteries and motors as well as it will be using algorithms and high-level detection to make it happen. It will also be possible to operate the AirButlr yourself, by using a smartphone application. This will enable users to command the AirButlr, after which the machine will clean up the place with the right cleaning materials. Interesting development, were curious whether this will become a big hit on Kickstarter or not. It could easily become something huge. Well, watch this video below to see how it will work', 'This 3D Printed Drone Can Clean Your House', '', 'publish', 'open', 'open', '', 'gallery-format', '', '', '2016-05-23 04:00:34', '2016-05-23 04:00:34', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?p=43', 0, 'post', '', 0),
