(47, 1, '2016-05-12 01:38:08', '2016-05-12 01:38:08', '[embed]https://youtu.be/4OfRD5bfJWA[/embed]\r\n\r\nBuzz Technology Limiteds 3D printer design is based on standard FDM technology but it can also reach for parts from a tray and integrate non-printable components into a 3D printed object.\r\n\r\nThe components can include electronic modules, wheels, electric motor power drives, cameras, sensors, remote control and all kinds of stuff so that at the end of the production process you could get a working 3d printed device. They have demonstrated it on a toy car where the framewas 3D printed with different filaments and then the powered wheels modules placed in it.\r\n\r\n<img class="aligncenter size-full wp-image-41" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/3dprinting-history.jpg" alt="3dprinting-history" width="913" height="447" />This is a a new approach in commercial machine but many questions remain open. It would be interesting to see what type of software drives it and what is the g-code behind magnetic embedding arm or how does one program what part to take out of the tray and where to place it.\r\n\r\nModeling everything and getting it to work seems like a very complex endeavor for a skilled CAD operator or designer but the idea behind it is to use some sort of manual g-code adjustments that will be learned in company webinars. The wiring of the parts is also not shown in detail so the parts are highly likely stand-alone modules but there arethree nozzles that can, in theory, extrude plastic, conductive and support / separation materials so electrical connections could be made with some sort of conductive material.', 'IR3 3D Printer That Can Integrate Non-printable Components', '', 'publish', 'open', 'open', '', 'video-format', '', '', '2016-05-28 03:51:17', '2016-05-28 03:51:17', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?p=47', 0, 'post', '', 0),
