(132, 1, '2016-05-21 07:04:29', '2016-05-21 07:04:29', 'When the editors at Make: tested the original Ultimaker in our first annual Ultimate Guide to 3D Printing, we were impressed with the machine''s speed and resolution. When we tested the Ultimaker 2 in our 2nd Ultimate Guide, we were even more impressed.\r\n\r\nThe Ultimaker 2 was created to be as easy to use as possible, letting you focus on creating and enjoying your prints instead of spending time tweaking and troubleshooting the machine. The printer features a bright OLED (organic light-emitting diode) screen which allows you to print files directly from an SD card, freeing up your computer to do other things. The glass-heated print bed accommodates ABS plastic printing (in addition to PLA filament) and the redesigned hot-end was designed with a smaller hot zone to reduce potential clogs and jams.\r\n\r\nCapable of printing from 30-300mm/s and up to a .02mm (20 micron) layer height, the Ultimaker 2 is the fastest, highest resolution FDM (fused-deposition modeling) printer on the market today', 'POETRY INFINITY', 'The Ira3D Poetry Infinity is a desktop 3D printer made by Ira3D an Italian manufacturer.\r\n\r\nThe Ira3D Poetry Infinity has a partially closed frame and a heated bed to print ABS, PLA, Nylon, PVA and PC. With a print speed of 400 mm/s and a speed of movement of 1100 mm/s the Ira 3D Poetry Infinity is really fast.\r\n\r\nThis 3D printer has two extruder for multi material 3D prints and has the capacity to use support material.', 'publish', 'open', 'closed', '', 'poetry-infinity', '', '', '2016-05-23 02:43:39', '2016-05-23 02:43:39', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=132', 0, 'product', '', 0),
(135, 1, '2016-05-21 07:14:41', '2016-05-21 07:14:41', 'When the editors at Make: tested the original Ultimaker in our first annual Ultimate Guide to 3D Printing, we were impressed with the machine''s speed and resolution. When we tested the Ultimaker 2 in our 2nd Ultimate Guide, we were even more impressed.\r\n\r\nThe Ultimaker 2 was created to be as easy to use as possible, letting you focus on creating and enjoying your prints instead of spending time tweaking and troubleshooting the machine. The printer features a bright OLED (organic light-emitting diode) screen which allows you to print files directly from an SD card, freeing up your computer to do other things. The glass-heated print bed accommodates ABS plastic printing (in addition to PLA filament) and the redesigned hot-end was designed with a smaller hot zone to reduce potential clogs and jams.\r\n\r\nCapable of printing from 30-300mm/s and up to a .02mm (20 micron) layer height, the Ultimaker 2 is the fastest, highest resolution FDM (fused-deposition modeling) printer on the market today.', 'ULTIMAKER 2 GO', '<h2>Product Features</h2>\r\n<div class="content">\r\n<ul>\r\n 	<li>World class specs.</li>\r\n 	<li>Industry-leading print-to-size ratio. Small footprint, large build volume.</li>\r\n 	<li>Premium materials used in construction.</li>\r\n 	<li>Stylish design means you don''t have to hide your printer when not in use</li>\r\n</ul>\r\n<h2>Product Details</h2>\r\n<div class="content">\r\n<ul>\r\n 	<li><b>Product Dimensions: </b>10.2 x 9.8 x 11.3 inches ; 1.8 pounds</li>\r\n 	<li><b>Shipping Weight:</b> 23.8 pounds</li>\r\n 	<li><b>ASIN:</b> B00ZDRB0X6</li>\r\n 	<li><b>Item model number:</b> UM2GO</li>\r\n</ul>\r\n</div>\r\n</div>', 'publish', 'open', 'closed', '', 'ultimaker-2-go', '', '', '2016-06-23 03:34:39', '2016-06-23 03:34:39', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/product/ultimaker-2-go/', 0, 'product', '', 0),
(168, 1, '2016-05-21 07:11:41', '2016-05-21 07:11:41', 'When the editors at Make: tested the original Ultimaker in our first annual Ultimate Guide to 3D Printing, we were impressed with the machine''s speed and resolution. When we tested the Ultimaker 2 in our 2nd Ultimate Guide, we were even more impressed.\r\n\r\nThe Ultimaker 2 was created to be as easy to use as possible, letting you focus on creating and enjoying your prints instead of spending time tweaking and troubleshooting the machine. The printer features a bright OLED (organic light-emitting diode) screen which allows you to print files directly from an SD card, freeing up your computer to do other things. The glass-heated print bed accommodates ABS plastic printing (in addition to PLA filament) and the redesigned hot-end was designed with a smaller hot zone to reduce potential clogs and jams.\r\n\r\nCapable of printing from 30-300mm/s and up to a .02mm (20 micron) layer height, the Ultimaker 2 is the fastest, highest resolution FDM (fused-deposition modeling) printer on the market today', 'SPARK 3D', 'Autodesk CTO Reveals Details of Their Spark 3D Printing Platform &amp; Printer: More coming at Inside 3D Printing Conference', 'publish', 'open', 'closed', '', 'spark-3d', '', '', '2016-05-23 03:03:54', '2016-05-23 03:03:54', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?product=afinia-h480', 0, 'product', '', 1),
