(194, 1, '2016-05-20 07:44:15', '2016-05-20 07:44:15', '[vc_row el_class="home-about-us" css=".vc_custom_1460001547360{margin-bottom: 80px !important;}"][vc_column width="1/2" el_class="video-application"][zo_heading class="printing-border-left" text="3D PRINTING APPLICATION" zo_template="zo_heading.php"][zo_video video_url="https://youtu.be/TbqusJclko8" thumbnail_custom="enable" video_info="enable" video_autoplay="enable" zo_template="zo_video.php" thumbnail_url="290"][vc_column_text css=".vc_custom_1463540590193{padding-top: 10px !important;padding-bottom: 20px !important;}"]Nowadays almost everything from aerospace components to toys are getting built with the help of 3D printers. One of the most important applications of 3D printing is in the medical industry...[/vc_column_text][/vc_column][vc_column width="1/2"][zo_heading class="printing-border-left" text="3D PRINTING BASIC" zo_template="zo_heading.php"][vc_tta_accordion][vc_tta_section title="What is 3D Printing?" tab_id="what"][vc_column_text]3D printing is a prototyping process whereby an real object is created from a 3D design. The digital 3D-model is saved in STL format and then sent to a 3D printer.[/vc_column_text][/vc_tta_section][vc_tta_section title="How much price for 3D Printer?" tab_id="how"][vc_column_text]3D printing is a prototyping process whereby an real object is created from a 3D design. The digital 3D-model is saved in STL format and then sent to a 3D printer.[/vc_column_text][/vc_tta_section][vc_tta_section title="What are the materials for 3D Printing?" tab_id="materials"][vc_column_text]\n<div class="faq">\n\n3D printing is a prototyping process whereby an real object is created from a 3D design. The digital 3D-model is saved in STL format and then sent to a 3D printer.\n\n</div>\n[/vc_column_text][/vc_tta_section][vc_tta_section title="What 3D software for design?" tab_id="software"][vc_column_text]\n<div class="faq">\n\n3D printing is a prototyping process whereby an real object is created from a 3D design. The digital 3D-model is saved in STL format and then sent to a 3D printer.\n\n</div>\n[/vc_column_text][/vc_tta_section][/vc_tta_accordion][/vc_column][/vc_row][vc_row equal_height="yes" content_placement="middle" css=".vc_custom_1463040608435{padding-top: 0px !important;padding-bottom: 0px !important;background-image: url(http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/3dprinting-about-bg.jpg?id=196) !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}" el_class="fullrow-max-md"][vc_column width="2/3" css=".vc_custom_1460002686972{padding-top: 90px !important;padding-bottom: 70px !important;}"][zo_heading class="printing-border-left-white" text="HOW WE WORK?" zo_template="zo_heading.php"][vc_column_text]\n<p style="color: #fff;">Not everybody can afford or is willing to buy their own 3D printer. Does this mean you cannot enjoy the possibilities of 3D printing? No, not to worry. Because we are here to help you bring your brand to life with 3D printing. When, for instance, you have an architecture practice and you need to build model scales, it is very time consuming doing this the old fashioned way...</p>\n[/vc_column_text][vc_empty_space height="25px"][zo_button text="Know More" align="left" padding_right="50" padding_left="50" class="btn-primary" zo_template="zo_button.php" link="||"][/vc_column][vc_column width="1/3" offset="vc_col-xs-12"][vc_single_image image="191" img_size="full" alignment="center" el_class="about-whoweare-img" css=".vc_custom_1463039683726{margin-top: -80px !important;margin-bottom: 0px !important;}"][/vc_column][/vc_row][vc_row el_class="fullrow-max-md" css=".vc_custom_1460003165037{padding-top: 100px !important;padding-bottom: 80px !important;}"][vc_column offset="vc_col-lg-6 vc_col-md-6 vc_col-xs-12"][zo_heading class="printing-border-left" text="WHO WE ARE?" zo_template="zo_heading.php"][vc_images_carousel images="192" img_size="530 x 250" onclick="link_no" autoplay="yes" hide_pagination_control="yes" wrap="yes"][vc_column_text css=".vc_custom_1463540737284{margin-top: 25px !important;margin-bottom: 30px !important;}"]It all starts with making a virtual design of the object you want to create. This virtual design is made in a CAD (Computer Aided Design) file using a 3D modeling program (for the creation of a totally new object)...[/vc_column_text][/vc_column][vc_column offset="vc_col-lg-6 vc_col-md-6 vc_col-xs-12"][zo_heading class="printing-border-left" text="WHY WE''RE EXPERT?" zo_template="zo_heading.php"][vc_column_text css=".vc_custom_1463540532277{margin-bottom: 25px !important;}"]If you have great idea for 3d printing, but dont know how to design, or you have interesting 3d design but no way to print it... well make it for you! In addition to 25 years of experience with 3D printing and its related software, and a flexible team dedicated entirely to you, 3D PRINTING also has:[/vc_column_text][zo_progressbar item_title="3D Designer" value="52" bg_color="" color="" width="100%" height="7px" zo_template="zo_progressbar.php" zo_progress_text_for_progress_bar="52"][zo_progressbar item_title="3D Printing" value="80" bg_color="" color="" width="100%" height="7px" zo_template="zo_progressbar.php" zo_progress_text_for_progress_bar="52"][zo_progressbar item_title="Completed project " value="96" bg_color="" color="" width="100%" height="7px" zo_template="zo_progressbar.php" zo_progress_text_for_progress_bar="52"][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces" equal_height="yes" content_placement="middle" css=".vc_custom_1463730745920{background-color: rgba(0,0,0,0.8) !important;*background-color: rgb(0,0,0) !important;}" el_class="background-primary"][vc_column width="1/2" css=".vc_custom_1463730793386{padding-top: 50px !important;padding-bottom: 50px !important;padding-left: 25px !important;}" offset="vc_col-xs-12"][zo_heading class="printing-border-left-whit