(216, 1, '2016-05-12 09:32:06', '2016-05-12 09:32:06', '3D Printing is an online 3D printing service for all people with an eye for design and a head full of ideas. Turn your ideas into 3D printed reality.\r\n\r\n<img class="alignnone wp-image-589" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/hero_artwork-300x138.jpg" alt="hero_artwork" width="981" height="452" />\r\n<h3>Dream it. Design it. Print it in 3D!</h3>\r\nYou already create cool designs in Photoshop. Now its time to turn those designs into real-world objects. Use the Photoshop tools you already know to design, color, and add texture to 3D designsfor design prototypes, fine art, jewelry, ornaments, and moreand then print them on your own 3D printer or via a 3D printing service.\r\n\r\nMany 3D printer profiles ship with Photoshop CC, and we make the latest ones available to you online. Simply download and install the profiles you want, and theyll be available from within Photoshop CC the next time you launch the app.\r\n\r\n<img class="alignleft wp-image-640 size-full" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/1509-Technology-and-electronic-products.jpg" width="900" height="679" />\r\n\r\n&nbsp;', '3D Printing', '', 'publish', 'closed', 'closed', '', '3d-printing', '', '', '2016-06-23 03:16:19', '2016-06-23 03:16:19', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=service&#038;p=216', 0, 'service', '', 0),
