(219, 1, '2016-05-12 09:34:57', '2016-05-12 09:34:57', 'The process of converting physical objects into precise digital models, enables you to quickly and accurately capture your object''s shape and geometries. This process supplies you with a complete digital representation of your part to be used for reverse engineering, quality inspection or at any point of a typical manufacturing cycle.\r\n\r\n<img class="aligncenter size-full wp-image-217" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/image-servicesl.jpg" alt="image-servicesl" width="870" height="400" />\r\n\r\nLet 3D scanning empower you with: rapid data capture, shortened production cycles, increased manufacturing efficiency, improved product quality, CAD models that reflect shop-floor changes. 3D scanning can be used in almost any engineering process and/or setting, and as a result there are many different ways that the data obtained can benefit you. While most customers require post-processing of 3D scan data, it is not necessary in some situations.\r\n<blockquote>Tell us your problem and we''ll do everything in our power to help you solve it. We are great project managers and are happy to perform large-scale service projects in addition to smaller projects. So whether you need simple STL data for 1 part, or class A surfaces of 500 parts, give us a call!</blockquote>\r\n<img class="aligncenter size-full wp-image-218" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/image-services1.jpg" alt="image-services1" width="870" height="400" />\r\n\r\nLet 3D scanning empower you with: rapid data capture, shortened production cycles, increased manufacturing efficiency, improved product quality, CAD models that reflect shop-floor changes. 3D scanning can be used in almost any engineering process and/or setting, and as a result there are many different ways that the data obtained can benefit you. While most customers require post-processing of 3D scan data, it is not necessary in some situations.', '3D SCANNING', '', 'publish', 'closed', 'closed', '', '3d-scanning', '', '', '2016-06-23 02:49:40', '2016-06-23 02:49:40', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=service&#038;p=219', 0, 'service', '', 0),
(220, 1, '2016-05-12 09:38:19', '2016-05-12 09:38:19', 'If you''re not that much of a designer, you''re able to use the creation corner where you can use your 3D modeling service to hire a professional designer to design your.\r\n\r\n<img class="alignnone wp-image-593" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/34691EE500000578-3602190-image-a-26_1463826066911-300x175.jpg" alt="34691EE500000578-3602190-image-a-26_1463826066911" width="819" height="478" />\r\n<p class="mol-para-with-font">Consisting of Dr Matheus Rabello, Dr Paulo Miamoto, Dr Roberto Fecchio, Cicero Moraes, Dr Sergio Camargo and Dr Rodrigo Rabello the experts volunteer their services and time.</p>\r\n<p class="mol-para-with-font">Based in Sao Paulo, the team have reconstructed artificial beaks for three toucans, a parrot, and a goose; designed the first ever titanium prosthetic pecker for a Macaw and built a brand new plastic-based replacement hull for a traumatised tortoise.</p>\r\n<p class="mol-para-with-font">Dr Fecchio said: ''We first came together as friends because of our common love of science and our love for animals.</p>\r\n\r\n<blockquote>\r\n<p class="mol-para-with-font">We soon realised we could do some extraordinary work using cutting-edge technology to push back the boundaries of life-saving care for mutilated animals by giving them customised prostheses.</p>\r\n</blockquote>\r\n<img class="alignnone wp-image-595" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/34691EC100000578-3602190-image-a-24_1463826052716-1-300x237.jpg" alt="34691EC100000578-3602190-image-a-24_1463826052716" width="819" height="647" />\r\n<p class="mol-para-with-font">Dr Matheus Rabello, who worked on the parrot, said: ''We were worried the renewable plastic used to make the prosthetics would not withstand the demands of a parrot''s beak, which is used to crack nuts and to climb.''</p>\r\n<p class="mol-para-with-font">However, the prosthesis proved to be a super-strong substitute.</p>\r\n<p class="mol-para-with-font">Another touchstone triumph with the first prosthetic beak built for a goose. The poor gander named Vitoria, had lost most of its top and bottom choppers and would have died without urgent corrective surgery.</p>\r\n<p class="mol-para-with-font">They also produced the world''s first titanium beak for Gigi, an abandoned Macaw.</p>\r\n<p class="mol-para-with-font">The breakthrough bionic 3D metal beak was attached to the Macaw''s severely damaged beak with bone cement and secured with eight colourful orthopaedic screws.</p>', '3D DESIGN', '', 'publish', 'closed', 'closed', '', '3d-design', '', '', '2016-06-23 02:50:46', '2016-06-23 02:50:46', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=service&#038;p=220', 0, 'service', '', 0),
(221, 1, '2016-05-12 09:40:37', '2016-05-12 09:40:37', '<p class="p1">Using a unique apprenticeship program to help train underserved communities learn advanced manufacturing skills such as 3D printing, wehave just been given the opportunity to expand their approach even further. We have just been awarded with a whopping $4.9 million grant from the U.S. Department of Labor to help expand their apprenticeship model. We have already trained over 3,000 workers over the past five years, operating out of their home base</p>\r\n<img class="alignnone wp-image-597" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/education-300x200.jpeg" alt="education" width="836" height="557" />\r\n\r\n<em>This award recognizes a unique approach to apprenticeship building in West Virginia  praised by the DOL  that has the potential to be replicated across the nation and to address the growing skills gap in manufacturing,</em> said Charlotte Weber, Director and CEO. By supporting manufacturing technology training, we have been encouraging job creation, economic development, and innovation across West Virginia and, now, with help from this new grant, across the United States, too.\r\n\r\n<img class="alignnone wp-image-598" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/3dprinting-300x199.jpg" alt="3dprinting" width="822" height="545" />', 'EDUCATION', '', 'publish', 'closed', 'closed', '', 'education', '', '', '2016-05-23 05:15:57', '2016-05-23 05:15:57', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=service&#038;p=221', 0, 'service', '', 0),
