(227, 1, '2016-05-12 09:41:29', '2016-05-12 09:41:29', 'lf you''re not that much of a designer, we offer apps &amp; support about technical And you can design your own products, with the precision of a professional designer.\r\n\r\n<img class="alignnone wp-image-601" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/News-rk-300x188.jpg" alt="News rk" width="793" height="497" />\r\n\r\nRight now, the team is working on creating a prototype for the insole by taking 3D scans of Marcos feet and other patients with feet problems. The team is also working on getting more doctors on board with the project.\r\n\r\nWere trying to see if insurance could cover the appointment because that would be huge. Realistically, a lot of people who have foot problems are older, and if it could get covered by insurance, it would save a lot of money, Marco said.When creating Digifeet, one of the biggest challenges the team faced was creating a unique product. Other companies do make insoles, but 3D scanning is the ultimate way to make custom insoles, Marco said.\r\n\r\n<img class="alignnone wp-image-602" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/evaluate-300x175.jpg" alt="evaluate" width="811" height="473" />', 'IDEA & SOLUTION', '', 'publish', 'closed', 'closed', '', 'idea-solution', '', '', '2016-05-23 05:13:46', '2016-05-23 05:13:46', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=service&#038;p=227', 0, 'service', '', 0),
(228, 1, '2016-05-12 09:42:35', '2016-05-12 09:42:35', 'If you have a good idea and you want to see your idea being turned into a functional prototype, we can help you print a wide variety of products.This process supplies you with a complete digital representation of your part to be used for reverse engineering, quality inspection or at any point of a typical manufacturing cycle.\r\n\r\n<img class="alignnone  wp-image-603" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/services-300x200.jpg" alt="services" width="800" height="533" />\r\n\r\nLet 3D scanning empower you with: rapid data capture, shortened production cycles, increased manufacturing efficiency, improved product quality, CAD models that reflect shop-floor changes. 3D scanning can be used in almost any engineering process and/or setting, and as a result there are many different ways that the data obtained can benefit you. While most customers require post-processing of 3D scan data, it is not necessary in some situations.\r\nTell us your problem and we''ll do everything in our power to help you solve it. We are great project managers and are happy to perform large-scale service projects in addition to smaller projects. So whether you need simple STL data for 1 part, or class A surfaces of 500 parts, give us a call!\r\n\r\n<img class="aligncenter size-full wp-image-218" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/image-services1.jpg" alt="image-services1" width="870" height="400" />', 'CUSTOMIZATION', '', 'publish', 'closed', 'closed', '', 'customization', '', '', '2016-05-23 05:20:21', '2016-05-23 05:20:21', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=service&#038;p=228', 0, 'service', '', 0),
