(262, 1, '2016-05-13 03:26:25', '2016-05-13 03:26:25', 'J-CAD Inc. has created a 3D printed Ashtray which automatically extinguishes and preserves unfinished cigars.The product was developed by a cigar enthusiast named Ray, who contacted J-CAD Inc., a company that specializes in 3D CAD design and drafting to create a simple design for the automatic cigar ashtray.With the help of J-CAD, Ray completed the prototype of a unique creation, which activates a set of blades inside to cut off oxygen supply that fuels the burn, and preserve left over cigar.\r\n<blockquote><em class="font-second">"Sensibus oportere signiferumque id mea. At usu lucilius phaedrum, vix oratio epicurei ne. Eripuit conceptam sea cu, ius minim delectus euripidis cu. Probo nonumy gubergren id nec. In est probo ridens, his laoreet euripidis et."</em></blockquote>\r\nThe prototype was printed with a UV-cured acrylic on a 3D Systems project 3000 3D printer, 3Dprint.com reported. It took around 20 hours to print the whole device, and another 2 hours to remove paint, support material and to assemble it.\r\n\r\n<img class="aligncenter wp-image-41 size-full" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/3dprinting-history.jpg" alt="3dprinting-history" width="913" height="447" />\r\n\r\nRay stated, A premium cigar can sometimes take an hour or more to smoke, but many times a person doesnt have time to finish a cigar. I was looking for a portable cigar ashtray that would extinguish a partially smoked cigar while keeping the wrapper intact. All the portable ashtrays I found were lacking in the characteristics I was looking for.\r\n\r\nJason Vander Griendt of J-CAD said in an interview, We were contacted by [Ray] who was very passionate about cigars. In the midst of the Cuban  USA relations improving in 2014, he wanted us to design a device that could be used as a cigar ashtray with some added design benefits as he predicted an immediate increase in the Cuban cigar industry in the USA.', '3D Printed Ashtray Preserves Cigars Automatically', '', 'publish', 'open', 'open', '', '3d-printing-in-producing-furniture', '', '', '2016-05-23 03:36:51', '2016-05-23 03:36:51', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?p=262', 0, 'post', '', 2),
